import Navbar from "../components/Navbar";

const ListaCarros = () => {
    <Navbar></Navbar>
    return(
        <>
        <div>
            <ul>
                <li>
                    <a href="/home" class="flex flex-col items-center bg-white border border-gray-200 rounded-lg shadow-sm md:flex-row md:max-w-xl hover:bg-gray-100 dark:border-gray-700 dark:bg-gray-800 dark:hover:bg-gray-700">
                        <img class="object-cover w-full rounded-t-lg h-96 md:h-auto md:w-48 md:rounded-none md:rounded-s-lg" src="" alt=""/>
                        <div class="flex flex-col justify-between p-4 leading-normal">
                            <h5 class="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">Noteworthy technology acquisitions 2021</h5>
                            <p class="mb-3 font-normal text-gray-700 dark:text-gray-400">Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.</p>
                        </div>
                    </a>
                </li>
                <li>Carro 1</li>
                <li>Carro 1</li>
                <li>Carro 1</li>
                <li>Carro 1</li>
            </ul>
        </div>
        </>
    );
};

export default ListaCarros;
